import React from 'react'
import { useState } from 'react';

export const ProfilePage = () => {
    const TestData = {
        "id": 1,
        "testName": "Are you seek?",
        "description": "Yes",
        "type": 1,
        "questions": [
        {
            "id": 1,
            "question": "Why are you worked there",
            "subanswers": [
                {
                    "id": 1,
                    "answer": "This is me",
                    "score": 99
                },
                {
                    "id": 2,
                    "answer": "This is",
                    "score": 23
                }
            ]
        },
        {
            "id": 4,
            "question": "Is not a quest",
            "subanswers": [
                {
                    "id": 5,
                    "answer": "This is 1",
                    "score": 2
                },
                {
                    "id": 6,
                    "answer": "This is 2",
                    "score": 4
                },
                {
                    "id": 7,
                    "answer": "This is 3",
                    "score": 5
                }
            ]
        }
    ]
    }
    const [profileBlock,setBlock] = useState(<div className="ProfileMain">
        <img src={'./img/peopleProfile.jpg'} alt="" className="ProfileImg" />
        <div className="ProfileText">
            <div className="ProfileTop">
                <h2>Здравствуйте,Алина</h2>
                <p>ФИ - Алина Гельдаш</p>
                <p>Компания - Justice</p>
                <p>Почта - geldashal@gmail.com</p>                        
            </div>
            <div className="ProfileBottom">
                <h3>Текущий прогресс тестирования</h3>
                <p>ФИ - Алина Гельдаш</p>
                <div className="ProfileButton">
                    <button>Change</button>
                </div>
            </div>
        </div>
    </div>);

    return (
      <div className='Content'>
        <div className="Profile">
            <div className="ProfileHeader">
                <h1>Личный кабинет</h1>
            </div>
            {profileBlock}
        </div>
      </div>
    )
  }
